function generateTransferPhrase(player, newTeam) {
  const verbs = ['fechou com', 'assinou com', 'se transferiu para'],
    randomValue = Math.round(Math.random() * 2000) / 10,
    randomCurrency = CURRENCIES[Math.floor(Math.random() * CURRENCIES.length)],
    showCurrency = (Math.round(Math.random() * 5) % 2 === 0 ? true : false),
    randomVerb = Math.floor(Math.random() * verbs.length),
    header = (Math.round(Math.random() * 2) === 1 ? 'Mercado da bola: ' : ''),
    position = (Math.round(Math.random() * 5) % 2 === 0 ? `O ${POSITIONS[player.position]} ` : ''),
    gentilic = (Math.round(Math.random() * 1) === 1 ? `${GENTILICS[player.nationality]} ` : '');

  return `${header}${position}${gentilic}${player.name} do ${player.currentTeam} ${verbs[randomVerb]} ${newTeam} ${showCurrency ? `por ${randomValue} MUSD de ${randomCurrency}` : ''}`.toUpperCase();
}

